import React from "react";
import "./App.css";
// import NotFound from "pages/NotFound";
// import AppBar from "components/AppBar";
// import MasterPage from "pages/MasterPage";
import { Card, Text, ShellBar, ThemeProvider } from "@ui5/webcomponents-react";

const App = () => {
  return (
    <div className="App full-height">
      ThemeProvider
      <ShellBar
        logo={<img src="logo192.png" />}
        primaryTitle="React with UI5 Web Component with CAP API"
      ></ShellBar>
      <Card
        heading="UI5 fundamentals"
        style={{ width: "1050px" }}
      >

        <Text >
          This course teaches about fundamentals of UI5 components which can
          be used to develop your application. You will learn about
          different components in this course
        </Text>
      </Card>

    </div>
  );
};

export default App;
